    function lineTouches(a1,a2, b1, b2, c1, c2){
        if(a2>=b2 && a2<=c2){
            if(a1>=b1 && a1<=c1){
                return true;
            }
        }else if(a1>=b1 && a1<=c1){    
            if(a2>=b2 && a2<=c2){
                return true;
            }
        }else{
            return false;
        }
    }
